import React from 'react';
import { Formik, Field } from 'formik';
//import TextField from '@material-ui/core/TextField';

function FormikSelect() {
    return (
        <div>
            <Formik
                initialValues={{ beerType: 'test' }}
                onSubmit={data => {
                    console.log("submit:", data);
                }}
            >
                {({ values, handleChange, handleBlur, handleSubmit }) => (

                    <form className="form" onSubmit={handleSubmit}>
                        <Field component="select" id="category" name="beer type" value={values} className={"form-control"} onChange={handleChange}>
                            <option value="lokaler">Lokaler</option>
                            <option value="jobb">Jobb</option>
                            <option value="saker-ting">Saketing</option>
                            <option value="evenemang">Evenemang</option>
                        </Field>
                    </form>
                )}
            </Formik>
        </div>
    );
}

export default FormikSelect;
